import React from "react";
import "../navbarWithToggle/NavbarToggle.css";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import togglerIcon from "../images/togglerIcon.svg";
import Scrollspy from "react-scrollspy";
// import Scrollspy from "react-scrollspy";
import { Link, animatedScroll as scroll } from "react-scroll";
const NavbarToggle = () => {
  return (
    <div className="navbar">
      <div className="mobileNav d-md-flex justify-content-center">
        {/* <Scrollspy
          scrollTargetIds={[
            "services",
            "projects",
            "timeline",
            "team",
            "contact",
          ]}
        > */}
        <input className="menu-btn" type="checkbox" id="menu-btn"></input>
        <label className="menu-icon" htmlFor="menu-btn">
          <span className="navicon"></span>
        </label>
        <ul className="menu">
          <li className="menu-link">
            <Link
              activeClass="active"
              to="service"
              spy={true}
              smooth={true}
              offset={-50}
              duration={500}
            >
              <a href="#service">SERVICES</a>
            </Link>
          </li>
          <li className="menu-link">
            <Link
              activeClass="active"
              to="projects"
              spy={true}
              smooth={true}
              offset={-50}
              duration={500}
            >
              <a href="#projects">PROJECTS</a>
            </Link>
          </li>
          <li className="menu-link">
            <Link
              activeClass="active"
              to="section1"
              spy={true}
              smooth={true}
              offset={-70}
              duration={500}
            >
              {" "}
              <a href="#timeline">TIMELINE</a>
            </Link>
          </li>
          <li className="menu-link">
            <a href="#team">TEAM</a>
          </li>
          <li className="menu-link">
            <a href="#contact">CONTACT</a>
          </li>
        </ul>
        {/* </Scrollspy> */}
      </div>
    </div>
  );
};

export default NavbarToggle;
